const { TableRow, TableCell, IconButton } = require("@material-ui/core");
const { AiFillInfoCircle } = require("react-icons/ai");
const { BsTrash } = require("react-icons/bs");
const { Link } = require("react-router-dom");

const CourseRow = (props) => {
    const row = props.row
    const handleDelete = props.delete

    return (
        <TableRow key={row.mamh}>
            <TableCell size="small" component="th" scope="row">
                {row.mamh}
            </TableCell>
            <TableCell size="small">{row.tenmh}</TableCell>
            <TableCell size="small">{row.sotinchi}</TableCell>
            <TableCell size="small">{row.bomon}</TableCell>
            <TableCell size="small">{row.phanloai}</TableCell>
            <TableCell size="small" align='center'>
                <IconButton className="p-0 mx-3 text-danger">
                    <Link style={{ lineHeight: "1em" }} to={`/course/${row.mamh}`}>
                        <AiFillInfoCircle size="24px" />
                    </Link>
                </IconButton>
                <IconButton className="p-0 mx-3 text-danger">
                    <BsTrash
                        size="24px"
                        onClick={() => handleDelete(row.mamh)}
                    />
                </IconButton>
            </TableCell>
        </TableRow>
    )
}

export default CourseRow
